const t=document.querySelector("#comment"),e=document.querySelector("#dayhour"),n=document.querySelector("#humidity"),o=document.querySelector("#temp"),r=document.querySelector("#wind");fetch("https://weatherdbi.herokuapp.com/data/weather/innopolis").then((t=>t.json())).then((c=>{const i=c;t.textContent=i.currentConditions.comment,e.textContent=i.currentConditions.dayhour,n.textContent=i.currentConditions.humidity,o.textContent=i.currentConditions.temp.c.toString(),r.textContent=i.currentConditions.wind.km.toString()}));
